import React, { Component } from 'react';
import axios from 'axios';

class Taskmaster extends Component {
  onClick = n => {
    const url = 'https://safe-anchorage-33083.herokuapp.com';

    // Morning
    if (n === 0) {
      axios.get(url + '/api/tokens/cat/7').then(res => {
        this.setState({ catBus: res.data });
      });
      console.log('Morning tasks created.');
    } else if (n === 1) {
      //   console.log('yerp');
    }
  };
  render() {
    return (
      <div class="text-center pt-3">
        <button
          onClick={() => {
            this.onClick(0);
          }}
        >
          <div>
            <i class="fas fa-coffee"></i>
          </div>
          <div>Morning Block</div>
        </button>
      </div>
    );
  }
}

export default Taskmaster;
